-- lua script
module (..., package.seeall)

function main()
    print("==================================")
    print("==================================")
end

function main1(t1)
    print("==================================")
    print("in unit t1 = " .. t1)
    print("==================================")
end

function main2(t1, t2)
    print("==================================")
    print("in unit t1 = " .. t1)
    print("in unit t2 = " .. t2)
    print("==================================")
end

function main3(t1, t2, t3)
    print("==================================")
    print("in unit t1 = " .. t1)
    print("in unit t2 = " .. t2)
    print("in unit t3 = " .. t3)
    print("==================================")
end

function main4(t1, t2, t3, t4)
    print("==================================")
    print("in unit t1 = " .. t1)
    print("in unit t2 = " .. t2)
    print("in unit t3 = " .. t3)
    print("in unit t4 = " .. t4)
    print("==================================")
end

function main5(t1, t2, t3, t4, t5)
    print("==================================")
    print("in unit t1 = " .. t1)
    print("in unit t2 = " .. t2)
    print("in unit t3 = " .. t3)
    print("in unit t4 = " .. t4)
    print("in unit t5 = " .. t5)
    print("==================================")
end
